import React from "react";
import "./ButtonsPrincipais.css";

const ButtonsPrincipais = () => {
  return (
    <div className="div-btn">
      <button className="btn">Quero <p className="">Expor</p></button>
      <button className="btn">Como <p>Chegar</p></button>
      <button className="btn">Fale <p>Conosco</p></button>
    </div>
  );
};

export default ButtonsPrincipais;
